class CreateLoginComponent extends React.Component{  
    goTomain() {
        fetch("http://localhost:3000/login", {
          method: 'GET',
          headers : {
            "task" : 'login'
          },
        })
        .then(res =>res.json())
      };
    render() { 
        return (
            <div className="space-y-4">
            <input type="text" placeholder="Username" className="w-full p-2 border rounded-md" />
            <input type="password" placeholder="Password" className="w-full p-2 border rounded-md" />
            <button id="login-btn" className="w-full p-2 bg-blue-500 text-white rounded-md hover:bg-blue-600" >Login</button>
            <button id="signup-btn" className="w-full p-2 bg-green-500 text-white rounded-md hover:bg-green-600">Sign Up</button>
            </div>
        )
    }
}

export default CreateLoginComponent
